CREATE TABLE `customers` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `company_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `nid_front_image` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nid_back_image` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `front_data` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `back_data` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `bn_name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `en_name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `father_name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `mother_name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `date_of_birth` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nid_number` varchar(25) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `mobile_number` varchar(15) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `present_address` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `permanent_address` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `blood_group` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `place_of_birth` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `issue_date` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nid_unique_data` varchar(250) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `step_compleate_status` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_self_request` int(11) NOT NULL DEFAULT 0,
  `self_request_id` int(11) NOT NULL DEFAULT 0,
  `status` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '1: accept request',
  `accepted_user_id` int(11) NOT NULL DEFAULT 0,
  `accepted_timestamp` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

